description:
BlackShot is a massively multiplayer online first-person shooter under development by Korean company Vertigo Games, for Microsoft Windows-based PCs. There are several different versions of this game for different regions of the world. The game is a militaristic first-person shooter  with weapons, characters and gritty environments. It takes place in urban environments ranging from deserted cities to Arabian desert tribe lands.
